import { container, Row, Col } from 'react-bootstrap';

function Mahasiswa(){
    return (
        <Container>
            <Row>
                <Col><h2>Data Mahasiswa</h2></Col>
            </Row>

        </Container>
    )
}

export default Mahasiswa;
